import React from "react";
import Carousel from "react-bootstrap/Carousel";
import i1 from "../image/memory1.jpg";
import i2 from "../image/memory2.jpg";

const pages = [i1, i2, i1, i2, i1, i2];
class Memories extends React.Component {
  render() {
    return (
      <>
        <div
          style={{
            height: "95%",
            width: "95%",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            fontFamily: "Dancing",
            borderRadius: "25px",
            boxShadow: "3px 6px 10px 10px #585858",
          }}
        >
          <Carousel>
            <Carousel.Item
              style={{
                height: "100%",
                width: "100%",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                fontFamily: "Dancing",
                backgroundImage: pages[0],
                backgroundSize: "cover",
                backgroundPosition: "center",
                //   borderRadius: "25px",
                //   boxShadow: "3px 6px 10px 10px #585858",
              }}
            >
              <img src={pages[0]} alt="First slide" />
            </Carousel.Item>
          </Carousel>
        </div>
      </>
    );
  }
}
export default Memories;
